import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/styles';
import { Button, Card, CardContent, Grid, Typography, Avatar, Container } from '@material-ui/core';
import ArrowDownwardIcon from '@material-ui/icons/ArrowDownward';
import MoneyIcon from '@material-ui/icons/Money';
import FitnessCenterOutlinedIcon from '@material-ui/icons/FitnessCenterOutlined';
import { MapContainer } from 'views/PropertySearch/components';

const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    padding: 20
  },
  content: {
    alignItems: 'center',
    display: 'flex'
  },
  title: {
    fontWeight: 700
  },
  avatar: {
    backgroundColor: theme.palette.error.main,
    height: 56,
    width: 56
  },
  icon: {
    height: 20,
    width: 20
  },
  difference: {
    marginTop: theme.spacing(2),
    display: 'flex',
    alignItems: 'center'
  },
  differenceIcon: {
    color: theme.palette.error.dark
  },
  differenceValue: {
    color: theme.palette.error.dark,
    marginRight: theme.spacing(1)
  }
}));
const data = [1,2,3,4];
const Location = props => {
  const { className, ...rest } = props;

  const classes = useStyles();

  return (
    <Card
      {...rest}
      className={classes.root}
      style={{overflow:'hidden', maxWidth:800}}

    >
        <Typography
              className={classes.title}
              color="textSecondary"
              gutterBottom
              variant="h5"
          >
              Distance to UT Tower 0.8mi
          </Typography>
          <iframe
                width="600"
                height="450"
                frameborder="0"
                src="https://maps.googleapis.com/maps/api/staticmap?key=AIzaSyDyi3-sGMcazywC1itfue3gs3SbMI17E4Q
                    &q=Space+Needle,Seattle+WA" allowfullscreen>
        </iframe>
    </Card>
  );
};

Location.propTypes = {
  className: PropTypes.string
};

export default Location;
